exports.uploadsign = async (req, res) => {
    try {
        let dir = config.COMMON_UPLOAD_PATH;
        const docs = req.files.c_sign;


        if (docs) {
            let docFile = docs;
            let orignaldocname = docFile.name;

            if (!fs.existsSync(dir)) {
                fs.mkdirSync(dir);
            }
            var file_name_ar = docFile.name.split(".");

            if (docFile.mimetype === 'image/jpeg' || docFile.mimetype === 'image/png' || docFile.mimetype === 'image/jpg' || docFile.mimetype === 'image/PNG') {
                docFile.mv(config.COMMON_UPLOAD_PATH + `${orignaldocname}`, function (err) {
                    if (err) {
                        res.status(500).send({message: err.message});//console.log(err);
                    } else {
                        var dataupdates =
                            {
                                n_userid: req.userId,
                                c_sign: config.COMMON_UPLOAD_PATH + `${orignaldocname}`
                            }


                        //let user = esign.count({where: {n_userid : req.body.id}});
                        esign.count({
                            where: {
                                n_userid: req.userId
                            }
                        }).then(data => {
                            if (data > 0) {
                                esign.update(dataupdates, {where: {n_userid: req.userId}}).then(signdata => {
                                    res.status(200).send({
                                        status: true,
                                        message: "Sign Uploaded Successfully",
                                        data: signdata
                                    });
                                });
                            } else {
                                esign.create(dataupdates).then(existeddata => {
                                    res.status(200).send({
                                        status: true,
                                        message: "Sign Uploaded Successfully",
                                        data: existeddata
                                    });
                                });

                            }
                        });

                    }

                });
            }
        }

    } catch (err) {
        res.status(500).send({status: false, message: err.message, data: {}});
    }

}

